  (3,'movie',643532,'/60AQOrByV9vDCqy6nt4eOroRild.jpg','The Card Counter',2021,'the-card-counter',FALSE,6,'Disappointing','Was expecting story about card games and so, but this movie is more about the protagonist life after serving in the army and the horrible things where he was involved in.','2021-10-04 08:04:38.138+02','2021-11-02 14:31:51.462+01','2021-10-02 00:00:00+02',FALSE),
