  (166,'movie',64635,'/fucmGeZYM4yzqJUnDTc4pKQNCej.jpg','Total Recall',2012,'total-recall-2',FALSE,6,'Way better than original','It''s same, but way better <a href=''https://movies.juliuszlioba.com/movies-evening-list/total-recall''>Total Recall (1990)</a>, but with same problems.<br><br />
  <p><img src=''https://media.giphy.com/media/C6JQPEUsZUyVq/giphy.gif'' style=''width: 100%; max-width: 350px;''></p><br />
  The original one was at best ''pile of peace of shit'', and this reboot is just ''a stinky poop'' a.k. a way more enjoyable decent movie with nice action scenes and pretty beautiful CGI scenery, but bad story. Even it''s way better but still falls short on the same story problems. And thank god for this time no Mars and alien shit in this one. There are few flaws in the main story, what destroys the really good story concept. They could have at least tried better to improve some motivations of characters, to be a more believable story. But oh well, now it''s just one-time action-packed same candy with a different outer layer and crapy core.','2018-04-15 23:12:11+02','2018-04-15 23:12:11+02','2018-04-15 02:00:00+02',FALSE),
