  (194,'movie',335983,'/2uNW4WbgBXL25BAbXGLnLqX71Sw.jpg','Venom',2018,'venom',FALSE,5,'Visually stunning, story-wise dumb','Don''t know what to say. It''s not great, but not so so horrible too.<br />
