  (298,'tv',65942,'/5DZa4aDH5MZGcZDf8ouTxm2kH2Y.jpg','Re:ZERO -Starting Life in Another World-',2016,'rezero-starting-life-in-another-world',TRUE,10,'Love it','I loved the movie "Edge of Tomorrow" and any other movie or series that tries to show similar mechanics of reliving day after day is worth to try watching. And this anime showed that it can be done in the anime story. I''m not a huge fan of deep fantasy stories, but after seeing this series I might need to change my interests, while this story makes me badly want more. The story starts simply as its main character gets summoned from our world to the magical world, and as the story progresses, it gets way more philosophical, psychological and even mythological, showing what toll it can take on a person''s mind reliving the same previous point in time as you get back after dying with remembering everything that you did before. So far after 1 and a half-season, it stands very strongly on one of my favourites and I imagine it will get even more interesting as it will continue releasing new episodes.','2020-10-05 00:57:00+02','2022-07-12 15:52:57.518+02','2020-10-05 00:57:00+02',FALSE),
