  (1045,'tv',196400,'/gBkDlMaAVOVMRWWlRUHhkLAhNE3.jpg','Mobile Suit Gundam: The Witch from Mercury',2022,'mobile-suit-gundam-the-witch-from-mercury',TRUE,10,'I said I will never watch Gundam and look at me now... immediately top series','The team behind looks like was passionate about this project and put in a lot of effort, while it shines in animation quality. Every second or so episode has fighting scenes and each of them is so unique that it does not repeat itself and only brings something new to the story, so action is non-stop. The story starts pretty simple and a bit goofy or childish at first but quickly grows into something more serious as more subplots develop and politics get involved, and little by little mature into some serious shit. And then it reaches the first season finale... and oh boy... I was expecting some cliffhanger, but I have not imagined anything close to what actually happens. The last 30 seconds it just something else... it left me speechless and shocked about what I just watched. I can definitely say it''s one of the best anime moments I''ve ever seen, but it works so strongly because of what happens throughout the whole first season.
