  (118,'movie',181812,'/db32LaOibwEliAmSL2jjDF6oDdj.jpg','Star Wars: The Rise of Skywalker',2019,'star-wars-the-rise-of-skywalker',FALSE,3,'70% bullshit, but there is another 30%','I think it''s not fair completely criticize the movie, while it''s trying to make shit made after the last film look at least more decent and it''s on the right way, but in the end is still a very bad movie.<br />
  A lot of weird character motivations, unnecessary narratives which never gets resolved and plainly stupid premise of the story, makes this movie barely watchable. But nevertheless, there are some interesting parts in the movie, which could have to save it (it started to move in the right direction), but it was too late to develop, especially when it is already the third movie (and last) in series.<br />
  I don''t know where the Star Wars going to do after this. They can make something great when put right people in charge (see Mandalorian), but for now they really put movie arc in the grave and don''t know if new hope could born.','2020-03-15 22:59:33+01','2024-03-22 20:05:15+01','2020-03-15 22:59:33+01',FALSE),
  (427,'movie',181808,'/kOVEVeg59E0wsnXmF9nrh6OmWII.jpg','Star Wars: The Last Jedi',2017,'star-wars-episode-viii',FALSE,5,'Entertaining','It''s a little bit more entertaining as <a href=''https://movies.juliuszlioba.com/movies-evening-list/star-wars-episode-vii/''> Star Wars: The Force Awakens </a>and a story is <strong>not</strong> a complete copy of the old movie with new face, <i> even of course there is a lot of resemblance to </i> <a href=''https://movies.juliuszlioba.com/movies-evening-list/star-wars-episode-v/''> Star Wars: Episode V - The Empire Strikes Back </a>, but it has its own twists in the story.<br />
  An addition of new characters looks a little bit too much unnecessary ''including every single rase possible'' with a bit of feminism, but let''s see how it will develop later. But I starting to get used to Rey''s character and especially starting to like Kylo Ren''s character. Visually the movie is amazing. Storywise it''s not so perfect, but still reasonable and with new winds. I''m looking forward to the future films.<br />
  <strong>Update:</strong> After second watch I see more flaws in it (and for that, I''m bringing down my rating), but it''s still entertaining. There is a lot of plot holes and horrible unnecessary Disney things inside, I''m still looking forward to next one. I hope it''s going be shit :D so the franchise could finally get under six feet under for resting in peace.<br />
  It''s not original Star Wars. It''s trying to be something new and I give some praise for that.','2018-03-17 16:00:03+01','2024-03-22 20:05:50+01','2017-12-28 01:00:00+01',FALSE),
